import React, { useState } from "react";
import "./App.css";
import axios from 'axios';

function App() { 
  const [crypto , setCrypto] = useState('')
  const [img , setImg] = useState('')
  const [Name , setName] = useState('')
  const [Symbol , setSymbol] = useState('')
  const [link, setLink] = useState('')
  const [eur, setEur] = useState('')
  const [Usd, setUsd] = useState('')
  const [des, setDes] = useState('')


  const hasFormSubmit = () => {
    const url = 'https://api.coingecko.com/v3.0.1/reference/coins-list';
    axios.get (url).then(res => {
      console.log(res.data);

      setImg(res.data.img.large);
      setName(res.data.name);
      setSymbol(res.data.Symbol);
      setLink(res.data.link.homePage[0]);
      setEur('European  price' + res.data.market.data.current-Price.eur);
      setUsd('United state prise'+res.data.market.data.current-Price.usd);
      setDes(res.data.img.description);
      
    });
  }
  return (
    <div className="App">
      <h1 className="title">crypto search</h1>
      <div className="search">
        <input
                type="text"
                value={crypto}
                onChange={(e) => setCrypto (e.target.value)}
                placeholder="Enter The Name"
                required/>
                
      </div>
      <button  onClick={hasFormSubmit} type="submit" className="btn">submit</button>
      <div className="container">
        <div className="crypto-info">
          <img src={img} alt="crypto" width="150"/>
          <br/>
          <h1 className="title">{name}</h1>
          <h2>{Symbol}</h2>
          <h2><a className="link" href={link}>{link}</a> </h2>
          <br/>
          <h2>{ird}</h2>
          <h2>{usd}</h2>

        </div>
      </div>
    </div>
  )
}

export default App;
